const layout = {
  "navAnchor": "left",
  "navVariant": {
    // temporary || persistent || permanent
    "xs": "temporary",
    "sm": "permanent",
    "md": "temporary"
  },
  "navWidth": {
    "xs": 240,
    "sm": 256,
    "md": 256
  },
  "collapsible": {
    "xs": true,
    "sm": true,
    "md": true
  },
  "collapsedWidth": {
    "xs": 64,
    "sm": 64,
    "md": 64
  },
  "clipped": {
    "xs": false,
    "sm": false,
    "md": false
  },
  "headerPosition": {
    "xs": "sticky",
    "sm": "sticky",
    "md": "relative"
  },
  "squeezed": {
    "xs": true,
    "sm": true,
    "md": true
  },
  "footerShrink": {
    "xs": true,
    "sm": true,
    "md": true
  }
};

export default layout;
